import React from "react";
import Data from "../data.json";

function Card() {
  console.log(Data);
  return (
    <div>
      <div>
        <h1>Your Result</h1>
        <section>
          <p>76</p>
          <p>of 100</p>
        </section>
        <h2>Great</h2>
        <p>
          You scored higher than 65% of the people who have taken these tests.
        </p>
      </div>
      {Data.map((item, key) => {
        return (
          <div key={key}>
            <img src={item.icon} alt={item.category} />
            <p>{item.category}</p>
            <p>{item.score}/100</p>
          </div>
        );
      })}
    </div>
  );
}

export default Card;
